import React, {Component} from 'react';
import students from '../mock-data/students.json';

class Grid extends Component {
    constructor(props){
        super(props);

        this.state = {
            students: []
        }
    }

    render() {

        const gridStyle = {
            margin: '0 0 0 300px',
            width: '100px',
            border: '1px solid black',
            padding: '5px',
            display: 'block'
        }

        return (
            <div className = 'Grid' style={gridStyle}>
                    <div>
                    {students.map((studentItem, index)=>{
                        return <p key={studentItem.id}>{studentItem.name}</p>
                    })}
                    </div>
            </div>
        )
            }
}
export default Grid;
